import * as React from "react";
import {Container, Paper} from "@mui/material";
import Box from "@mui/material/Box";

export default function DayPlan() {

    const paperStyle = {
        padding: "50px 20px",
        width: "95%",
        margin: "20px auto",
        borderRadius: 20,
        backgroundColor: "#e9dbd3"
    }


    return (
        <Container>
            <Paper elevation={3} style={paperStyle}>
                <Box>
                    <div className="block-container">
                        <div className="block-title">План дня</div>
                        <div className="block-time">16:00</div>
                        <img src="path/to/your/image.png" alt="картинка" className="block-image"/>
                        <div className="block-description">
                            Сбор гостей, фуршет<br/>
                            Собираясь на торжество возьмите с собой свои улыбки и хорошее настроение
                        </div>
                    </div>
                </Box>
            </Paper>
        </Container>
    );
}
